import { StyleSheet, Text, View } from "react-native";
import React, { useState, useEffect } from "react";
import Axios from "axios";

const News = () => {
  const [data, setData] = useState([]);
  const getData = () => {
    Axios.get(
      "https://newsapi.org/v2/top-headlines?country=us&apiKey=55d7bf49be2b471e823fc66cacc0fb93"
    )
      .then((res) => {
        console.log(res);
        setData(res.data.articles);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <View style={styles.container}>
      <Text>News</Text>
    </View>
  );
};

export default News;

const styles = StyleSheet.create({
  container: {
    marginTop: 40,
    alignSelf: "center",
  },
});
